import React from 'react';
import "./Navbar.css"

const navbar = () => {
    return (
      <div className="navbar">
        {/* Projects */}
        <a href="#projects" className="classic-tab">
          Projects
          <div className="gloss-layer"></div>
        </a>

        {/* Garage */}
        <a href="#garage" className="classic-tab">
          <p>Garage</p>
          <div className="gloss-layer"></div>
        </a>

        {/* Contact */}
        <a href="#contact" className="classic-tab">
          Contact
          <div className="gloss-layer"></div>
        </a>
      </div>
    );
  };

  export default navbar;
